import React from 'react';
import Card from "./Card";
import CreateAccount from "./CreateAccount";

function Login() {
  return (
    <Card
        bgcolor="info"
        header="Log in"
        status={CreateAccount.status}
        body={
            <>
                <h5 class="login mb-4">Easily manage your bank accounts and finances online!</h5>
                <h6>Email address:</h6>
                <input type="input" className="form-control" id="email" placeholder="Enter your email" value={CreateAccount.email} onChange={CreateAccount.handleClick}/>
                <br/>
                <h6>Password:</h6>
                <input type="password" className="form-control" id="password" placeholder="Enter your password" value={CreateAccount.password} onChange={CreateAccount.handleClick}/>
                <br/>
            </>
        }
    />
  )
}

export default Login;
